from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message




@dataclass
class TempThreshold(_Message):

    # Температура перегрева
    overheat: int8_t
    # Температура захолаживания
    overcool: int8_t


class TempThresholdDict(TypedDict):

    # Температура перегрева
    overheat: Union[int8_t, int ]

    # Температура захолаживания
    overcool: Union[int8_t, int ]

